import './Work.scss';
import images from '../../constants/images';

const works = [
  { name: 'front-end' ,imgUrl: images.about01},
  { name: 'front-end' ,imgUrl: images.about02},
  { name: 'Corporate Design', imgUrl: images.about03},
  { name: 'Photography', imgUrl: images.about04}
]

